@dev Copy 'len' bytes from memory address 'src', to address 'dest'.
From https://github.com/GNSPS/solidity-bytes-utils/blob/master/contracts/BytesLib.sol
@param _preBytes bytes storage
@param _postBytes Bytes array memory

attributes.operations:
{
    let fslot := sload(_preBytes_slot)
    let slength := div(and(fslot, sub(mul(0x100, iszero(and(fslot, 1))), 1)), 2)
    let mlength := mload(_postBytes)
    let newlength := add(slength, mlength)
    switch add(lt(slength, 32), lt(newlength, 32))
    case 2 {
        sstore(_preBytes_slot, add(fslot, add(mul(div(mload(add(_postBytes, 0x20)), exp(0x100, sub(32, mlength))), exp(0x100, sub(32, newlength))), mul(mlength, 2))))
    }
    case 1 {
        mstore(0x0, _preBytes_slot)
        let sc := add(keccak256(0x0, 0x20), div(slength, 32))
        sstore(_preBytes_slot, add(mul(newlength, 2), 1))
        let submod := sub(32, slength)
        let mc := add(_postBytes, submod)
        let end := add(_postBytes, mlength)
        let mask := sub(exp(0x100, submod), 1)
        sstore(sc, add(and(fslot, 0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff00), and(mload(mc), mask)))
        for {
            mc := add(mc, 0x20)
            sc := add(sc, 1)
        }
        lt(mc, end)
        {
            sc := add(sc, 1)
            mc := add(mc, 0x20)
        }
        { sstore(sc, mload(mc)) }
        mask := exp(0x100, sub(mc, end))
        sstore(sc, mul(div(mload(mc), mask), mask))
    }
    default {
        mstore(0x0, _preBytes_slot)
        let sc := add(keccak256(0x0, 0x20), div(slength, 32))
        sstore(_preBytes_slot, add(mul(newlength, 2), 1))
        let slengthmod := mod(slength, 32)
        let mlengthmod := mod(mlength, 32)
        let submod := sub(32, slengthmod)
        let mc := add(_postBytes, submod)
        let end := add(_postBytes, mlength)
        let mask := sub(exp(0x100, submod), 1)
        sstore(sc, add(sload(sc), and(mload(mc), mask)))
        for {
            sc := add(sc, 1)
            mc := add(mc, 0x20)
        }
        lt(mc, end)
        {
            sc := add(sc, 1)
            mc := add(mc, 0x20)
        }
        { sstore(sc, mload(mc)) }
        mask := exp(0x100, sub(mc, end))
        sstore(sc, mul(div(mload(mc), mask), mask))
    }
}
